import React from 'react';
import './Blogs.css';

interface BlogPost {
  id: number;
  title: string;
  date: string;
  description: string;
  link: string;
}

const blogPosts: BlogPost[] = [
  {
    id: 1,
    title: "Building a Terminal-Style Portfolio with React",
    date: "2024-05-04",
    description: "Learn how to create a terminal-style portfolio website using React and TypeScript.",
    link: "https://medium.com/@yashbhangale/building-a-terminal-style-portfolio-with-react"
  },
  // Add more blog posts here
];

const Blogs: React.FC = () => {
  return (
    <div className="blogs-container">
      <div className="terminal-output">
        <div className="command-line">
          <span className="prompt">$</span>
          <span className="command">cat blogs.txt</span>
        </div>
        <div className="output">
          <h2 className="section-title">Blog Posts</h2>
          <div className="blog-list">
            {blogPosts.map((post) => (
              <div key={post.id} className="blog-post">
                <h3 className="blog-title">
                  <a href={post.link} target="_blank" rel="noopener noreferrer">
                    {post.title}
                  </a>
                </h3>
                <div className="blog-meta">
                  <span className="blog-date">{post.date}</span>
                </div>
                <p className="blog-description">{post.description}</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Blogs;
